@karuturi This issue exists in releases > 4.5.0 
Shouldn't this be fixed in 4.5.0, 4.5.1 and merged forward as per the new release process?
Or is the new process for releases 4.6+ only?

@devdeep the test you added seems fine and passes (the assert messages look like they can be better formulated to describe what went wrong)
I do not understand the relevance to these test with respect to the changed code though.
Don't get me wrong, you wrote a fine set of additional tests and cloudstack is not an easy book to read so I might be misreading your test. I would like it to be clear and obvious that the added tests test what has been changed in this PR.
